import React from "react";
import { Eye } from "lucide-react"; // Usa 'lucide-react' para Ã­conos modernos

const styles = {
  container: {
    backgroundColor: "#fffbe6",
    padding: "1.5rem",
    borderRadius: "10px",
    boxShadow: "0 2px 8px rgba(0,0,0,0.05)",
    position: "relative",
    marginBottom: "2rem",
  },
  viewDocs: {
    position: "absolute",
    top: "1rem",
    right: "1rem",
    color: "#007bff",
    textDecoration: "none",
    fontWeight: "500",
    fontSize: "14px",
    display: "flex",
    alignItems: "center",
    gap: "4px",
    cursor: "pointer"
  },
  title: {
    fontWeight: "bold",
    fontSize: "16px",
    marginBottom: "1.5rem",
  },
  field: {
    marginBottom: "1.2rem",
  },
  label: {
    fontWeight: "500",
    marginBottom: "8px",
    display: "block",
    fontSize: "14px",
  },
  inputContainer: {
    border: "2px dashed #ccc",
    borderRadius: "10px",
    padding: "1rem",
    backgroundColor: "#f4f4f4",
    cursor: "pointer",
    textAlign: "center",
    fontSize: "14px",
    fontWeight: "500",
    color: "#555",
  },
  hiddenInput: {
    display: "none",
  },
  fileInfo: {
    fontStyle: "italic",
    fontSize: "13px",
    color: "#333",
    marginTop: "0.5rem",
    textAlign: "center",
  },
};

const SubidaDocumentos = ({ documentos, setDocumentos }) => {
  const handleFileChange = (e, tipo) => {
    const file = e.target.files[0];
    if (file) {
      setDocumentos({ ...documentos, [tipo]: file });
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.viewDocs} onClick={() => alert("Mostrar documentos")}>
        <Eye size={16} /> Ver Documentos
      </div>
      <div style={styles.title}>Documentos Requeridos</div>

      <div style={styles.field}>
        <label style={styles.label}>Licencia de Conducir (PDF)</label>
        <label style={styles.inputContainer}>
          <input
            type="file"
            style={styles.hiddenInput}
            onChange={(e) => handleFileChange(e, "licencia_conducir")}
            accept=".pdf"
          />
          ðŸ“¤ Seleccionar archivo PDF
        </label>
        {documentos.licencia_conducir && (
          <div style={styles.fileInfo}>
            {documentos.licencia_conducir.name} (
            {(documentos.licencia_conducir.size / 1024).toFixed(2)} KB)
          </div>
        )}
      </div>

      <div style={styles.field}>
        <label style={styles.label}>Tarjeta de Propiedad (PDF)</label>
        <label style={styles.inputContainer}>
          <input
            type="file"
            style={styles.hiddenInput}
            onChange={(e) => handleFileChange(e, "tarjeta_propiedad")}
            accept=".pdf"
          />
          ðŸ“¤ Seleccionar archivo PDF
        </label>
        {documentos.tarjeta_propiedad && (
          <div style={styles.fileInfo}>
            {documentos.tarjeta_propiedad.name} (
            {(documentos.tarjeta_propiedad.size / 1024).toFixed(2)} KB)
          </div>
        )}
      </div>

      <div style={styles.field}>
        <label style={styles.label}>Certificado de ITV (PDF)</label>
        <label style={styles.inputContainer}>
          <input
            type="file"
            style={styles.hiddenInput}
            onChange={(e) => handleFileChange(e, "certificado_itv")}
            accept=".pdf"
          />
          ðŸ“¤ Seleccionar archivo PDF
        </label>
        {documentos.certificado_itv && (
          <div style={styles.fileInfo}>
            {documentos.certificado_itv.name} (
            {(documentos.certificado_itv.size / 1024).toFixed(2)} KB)
          </div>
        )}
      </div>
    </div>
  );
};

export default SubidaDocumentos;
